/*Table structure for table `easyops_adminsql` */

DROP TABLE IF EXISTS `easyops_adminsql`;

CREATE TABLE `easyops_adminsql` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `dbtype` varchar(32) COLLATE utf8_bin NOT NULL,
  `sqlname` varchar(64) COLLATE utf8_bin NOT NULL,
  `sqlstr` varchar(21000) COLLATE utf8_bin NOT NULL,
  `sqlpriv` varchar(256) COLLATE utf8_bin DEFAULT NULL,
  `sqldesc` varchar(256) COLLATE utf8_bin DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

/*Data for the table `easyops_adminsql` */

insert  into `easyops_adminsql`(`id`,`dbtype`,`sqlname`,`sqlstr`,`sqlpriv`,`sqldesc`) values (1,'oracle','占据空间最多的segment','select owner,segment_name, sum(bytes)/(1024*1024*1024) size_in_g from dba_segments group by owner,segment_name having sum(bytes)/(1024*1024*1024) > 1 order by size_in_g desc','','占据最多空间的segment'),(2,'oracle','sysdate1','select sysdate from dual','','sysdate'),(5,'oracle','系统失效对象','select * from dba_objects where status = \'INVALID\'',' ','invalid object'),(6,'oracle','查询数据库死锁','select decode(request, 0, \'Holder:\', \' Waiter:\') || s.inst_id || \':\' ||\n       s.sid || \',\' || s.serial# sess,\n       id1 || \'/\' || id2 \"id1/id2\",\n       l.type||\':\'||lmode || \'/\' || request \"lmode/request\",\n       ctime,\n       s.sql_id,\n       s.event,\n       s.last_call_et,\n       s.status,\n       s.username,\n       s.machine,\n       s.program\n  from gv$lock l, gv$session s\n where (id1, id2, l.type) in\n       (select id1, id2, type from gv$lock where request > 0)\n   and l.sid = s.sid\n   and l.inst_id = s.inst_id\n order by id1, ctime desc, request;',' ','查询数据库锁'),(7,'oracle','活跃session','SELECT /* XJ LEADING(S) FIRST_ROWS */\n             S.SID,\n             S.SERIAL# S#,\n             P.SPID,\n             NVL(S.USERNAME, SUBSTR(P.PROGRAM, LENGTH(P.PROGRAM) - 6)) USERNAME,\n             S.MACHINE,\n             S.EVENT,\n             S.P1 || \'/\' || S.P2 || \'/\' || S.P3 P123,\n             S.WAIT_TIME WT,\n             S.LAST_CALL_ET,\n             s.BLOCKING_INSTANCE || \':\' || s.BLOCKING_SESSION BLOCKING,\n             NVL(SQL_ID, S.PREV_SQL_ID) SQL_ID\n              FROM V$PROCESS P, V$SESSION S\n             WHERE P.ADDR = S.PADDR\n               AND S.STATUS = \'ACTIVE\'\n               AND P.BACKGROUND IS NULL;','','active session'),(8,'oracle','ebs查询死锁用户','SELECT c.client_identifier,\n       ppf.last_name,\n       c.prev_exec_start,\n       a.object_name,\n       a.object_type,\n       b.session_id,\n       c.serial#,\n       \'alter system kill session \'\'\' || b.session_id || \',\' || c.serial# || \'@\' || b.inst_id ||\n       \'\'\';\' AS a,\n       c.program,\n       c.username,\n       c.command,\n       c.machine,\n       c.lockwait\n\nFROM   sys.all_objects   a,\n       gv$locked_object   b,\n       gv$session         c,\n       applsys.fnd_user  fu,\n       apps.per_people_f ppf\nWHERE  a.object_id = b.object_id\nand    b.inst_id=c.inst_id\nAND    c.sid = b.session_id\nAND    c.client_identifier = fu.user_name(+)\nAND    ppf.person_id(+) = fu.employee_id;','','EBS查看哪张表示哪个用户操作导致的锁'),(9,'mysql','ebskilllog','select * from django_admin_log','','操作日志查询'),(10,'sqlserver','查询重要会议','select b.fd_name \'会议室\', a.fd_name \'会议内容\', CONVERT(varchar(100), a.fd_hold_date, 20) \'开始时间\',CONVERT(varchar(100), a.fd_finish_date, 20) \'结束时间\', c.fd_name \'发起人\',d.fd_name \'发起部门\'\nfrom km_imeeting_main a, km_imeeting_res b,sys_org_element c,sys_org_element d\nwhere b.fd_id=a.fd_place_id and a.doc_creator_id=c.fd_id and a.doc_dept_id=d.fd_id\nand b.fd_name in (\'43-7号会议室(容纳10人)\',\'42-1号会议室【视频会议】(容纳26人)\',\'43-1号会议室【视频会议】(容纳26人)\') \nand a.doc_status <> 41\norder by a.fd_hold_date','','查询重要会议'),(11,'sqlserver','查询数据库阻塞','SELECT * FROM  sys.sysprocesses WHERE blocked<>0\n','','查询数据库阻塞'),(12,'sqlserver','gettopsql10','select top(10) st.text as Query, qs.total_worker_time, qs.execution_count from sys.dm_exec_query_stats as qs CROSS Apply sys.dm_exec_sql_text(qs.sql_handle) AS st order by qs.total_worker_time desc\n','','查询最消耗CPU的SQL Top10');

/*Table structure for table `easyops_ansibletasks` */

